import axios from 'axios';

const KEY = 'AIzaSyA17u7ShGVn5-Hj3-qnM0cKjbYEgXesKgU';

export default axios.create({
    baseURL: `https://www.googleapis.com/youtube/v3`,
    params: {
        part: 'snippet',
        maxResults: 5,
        type: 'video',
        key: KEY,
      },
});
